  a.post-tag:hover, .bounty-indicator, .bounty-indicator-tab, .bounty-award,
  span.bounty-indicator-tab, #change-picture, .supernovabg, .hotbg,
  .nav li.youarehere a, .nav a:hover, a.button:hover, .edit-count,
